import { apiKey, PLAYLISTS, YOUTUBEURL } from './apis';
import ids from '../channelId/ids';

export const playlist = async (chanId) => {
  return await fetch(`
        ${YOUTUBEURL}${PLAYLISTS}?key=${apiKey}&channelId=${chanId}&maxResult=10&part=id,snippet
    `).then((res) => res.json());
};
